import React from 'react';

const Card = ( ) => {
    const {robots} = this.props;
    return (
        <div className='bg-light-green tc dib br3 pa3 ma2 grow bw2 shadow-S'>
            <img alt='robots' src={`https://robohash.org/${robots.id}?size=200x200`} />
            <div>
                <h2>{robots.name}</h2>
                <p>{robots.email}</p>
            </div>
        </div>
    )
}

export default Card;
